import { Pagin } from "./pagination";
import { Fragment } from "react";
import { useState } from "react";
import SearchIcon from "@mui/icons-material/Search";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
    backgroundColor: "#90B2D8",
    height: 1,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
    height: 1,
  },
}));
const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
    height: 1,
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
    height: 1,
  },
}));

export default function NeoplasmTable() {
  const [neo, setNeo] = useState(null);
  const [codes, setCodes] = useState([]);
  React.useEffect(() => {
    const fetchBooks = async () => {
      try {
        if (global.values && global.values.code) {
          const response = await fetch(
            `/codes/${global.values.code}/neoplasm`
          );
          if (response.ok) {
            const data = await response.json();
            setNeo(data);

            // Split the code string and set the values in the state
            const codeValues = global.values.code.split(",");
            setCodes(codeValues);
          } else {
            console.error("Failed to fetch data");
          }
        } else {
          console.error("Failed to fetch data");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };
    fetchBooks();
  }, [global.values.code]);

  return (
    <>
      <Box
        sx={{
          height: "20px",
          width: "100%",
          textAlign: "left",
          mt: "200px",
          ml: "10px",
        }}
      >
        <Pagin />
      </Box>
      <TableContainer
        sx={{
          mt: "60px",
          display: "flex",
          position: "absolute",
          width: "830px",
          ml: "-115px",
          height: "400px",
          overflowY: "scroll",
        }}
      >
        <Table sx={{ minWidth: "100px", height: "450px" }}>
          <TableHead>
            <TableRow>
              {/* Rest of your code */}
            </TableRow>
          </TableHead>

          <TableHead sx={{ height: "20px", border: "1px solid grey" }}>
            {/* Rest of your code */}
          </TableHead>

          <TableBody>
            {neo?.map((row) => (
              <StyledTableRow key={row.id}>
                <StyledTableCell component="th" scope="row">
                  {row.title}
                </StyledTableCell>
                {codes.map((code, index) => (
                  <StyledTableCell
                    key={index}
                    sx={{
                      border: "1px solid grey",
                      height: "20px",
                    }}
                    align="right"
                  >
                    {code}
                  </StyledTableCell>
                ))}
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}

